import React, { useState, useRef, useEffect } from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import TextareaAutosize from "@mui/material/TextareaAutosize";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";
import { useNavigate } from "react-router-dom";

function EssayGame() {
  const [essay, setEssay] = useState("");
  const [submitted, setSubmitted] = useState(false);
  const [loading, setLoading] = useState(false);
  const [timer, setTimer] = useState(0);
  const [timerActive, setTimerActive] = useState(false);
  const timerRef = useRef<NodeJS.Timeout | null>(null);

  useEffect(() => {
    if (timerActive && !submitted) {
      timerRef.current = setInterval(() => {
        setTimer((t) => t + 1);
      }, 1000);
    }
    return () => {
      if (timerRef.current) clearInterval(timerRef.current);
    };
  }, [timerActive, submitted]);

  const handleFocus = () => {
    if (!timerActive) setTimerActive(true);
  };

  const handleSubmit = () => {
    setLoading(true);
    if (timerRef.current) clearInterval(timerRef.current);
    setTimeout(() => {
      setLoading(false);
      setSubmitted(true);
    }, 1200);
  };

  return (
    <Box sx={{ minHeight: "100vh", bgcolor: "#b2dfdb", display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "flex-start", fontFamily: "Inter, Roboto, Open Sans, Arial, sans-serif", px: 2, pt: { xs: 3, sm: 5 } }}>
      <Box sx={{ width: '100%', maxWidth: { xs: 520, md: 720 }, bgcolor: "#fff", borderRadius: 4, boxShadow: 6, p: { xs: 4, md: 6 }, mb: 2, position: "relative", mx: 'auto', overflow: 'hidden' }}>
        <IconButton sx={{ position: "absolute", left: 8, top: 10, color: "#19376D", ml: 1 }} onClick={() => window.location.href = '/questions'}><ArrowBackIcon /></IconButton>
        <Typography variant="h6" fontWeight={700} mb={2}>What are the advantages of online education?</Typography>
        <Box sx={{ position: "absolute", right: 24, top: 16, color: "#19376D", fontWeight: 700, fontSize: 18 }}>
          {`${String(Math.floor(timer / 60)).padStart(2, '0')}:${String(timer % 60).padStart(2, '0')}`}
        </Box>
        <TextareaAutosize
          minRows={8}
          maxRows={20}
          value={essay}
          onChange={e => setEssay(e.target.value)}
          onFocus={handleFocus}
          placeholder="Essayinizi buraya yazın..."
          style={{
            width: '100%',
            minWidth: 0,
            minHeight: 300,
            maxHeight: '60vh',
            borderRadius: 16,
            padding: 20,
            fontSize: 18,
            boxShadow: "0 4px 24px rgba(10,29,86,0.08)",
            border: "1.5px solid #19376D",
            marginBottom: 24,
            resize: "vertical",
            outline: "none",
            fontFamily: "inherit",
            boxSizing: 'border-box',
            overflow: 'auto',
          }}
          disabled={submitted}
        />
        <Button
          variant="contained"
          sx={{
            background: submitted ? "#aaa" : "linear-gradient(90deg, #1DA1F2 60%, #19376D 100%)",
            color: "#fff",
            fontWeight: 600,
            borderRadius: 2,
            px: 4,
            py: 1.2,
            fontSize: 18,
            boxShadow: 2,
            textTransform: "none",
            width: "100%",
            transition: "background 0.2s",
            "&:hover": {
              background: submitted ? "#aaa" : "linear-gradient(90deg, #19376D 60%, #1DA1F2 100%)",
            },
          }}
          disabled={submitted || loading}
          onClick={handleSubmit}
        >
          {loading ? "Yükleniyor..." : "Bitir"}
        </Button>
        {submitted && (
          <Box sx={{ mt: 4, bgcolor: "#f3f3f3", borderRadius: 3, boxShadow: 2, p: 3 }}>
            <Typography variant="h6" fontWeight={700} mb={2}>AI Feedback</Typography>
            <Typography fontSize={16} mb={1}>Essay değerlendirmesi: Çok iyi! Yapısal olarak tutarlı, argümanlar açık.</Typography>
            <Typography fontSize={16} color="#43ea7c">Puan: 92/100</Typography>
          </Box>
        )}
      </Box>
    </Box>
  );
}

export default EssayGame;
